CREATE TABLE IF NOT EXISTS "kvm_vm_tags" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "vm_id" bigint NOT NULL REFERENCES "kvm_vm" ("id") DEFERRABLE INITIALLY DEFERRED, "tag_id" bigint NOT NULL REFERENCES "kvm_tag" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "term_session" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "status" varchar(255) NOT NULL, "output" text NULL, "attach" bool NOT NULL, "readonly" bool NOT NULL, "saveoutput" bool NOT NULL, "object_id" integer unsigned NOT NULL CHECK ("object_id" >= 0), "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "token_blacklist_blacklistedtoken" ("blacklisted_at" datetime NOT NULL, "token_id" bigint NOT NULL UNIQUE REFERENCES "token_blacklist_outstandingtoken" ("id") DEFERRABLE INITIALLY DEFERRED, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "token_blacklist_outstandingtoken" ("token" text NOT NULL, "created_at" datetime NULL, "expires_at" datetime NOT NULL, "user_id" bigint NULL REFERENCES "acc_account" ("id") DEFERRABLE INITIALLY DEFERRED, "jti" varchar(255) NOT NULL UNIQUE, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "acc_profile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "instance_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "acc_account" ("id") DEFERRABLE INITIALLY DEFERRED, "is_readonly" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "kvm_tag" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "description" text NULL, "name" varchar(255) NOT NULL, "color" varchar(7) NOT NULL, "instance_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "kvm_hypervisor_xmls" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "hypervisor_id" bigint NOT NULL REFERENCES "kvm_hypervisor" ("id") DEFERRABLE INITIALLY DEFERRED, "xmldata_id" bigint NOT NULL REFERENCES "kvm_xmldata" ("id") DEFERRABLE INITIALLY DEFERRED);
