CREATE TABLE IF NOT EXISTS "kvm_vm" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "description" text NULL, "name" varchar(255) NOT NULL, "vcpu" integer unsigned NULL CHECK ("vcpu" >= 0), "memory" integer unsigned NULL CHECK ("memory" >= 0), "hypervisor_id" bigint NOT NULL REFERENCES "kvm_hypervisor" ("id") DEFERRABLE INITIALLY DEFERRED, "instance_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED, "state" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "kvm_hypervisor" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "description" text NULL, "hostname" varchar(255) NOT NULL, "mgt_ip" char(39) NOT NULL, "instance_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED, "auth_id" bigint NULL REFERENCES "kvm_auth" ("id") DEFERRABLE INITIALLY DEFERRED, "uuid" varchar(64) NULL, "arch" varchar(16) NULL, "microcode_version" varchar(16) NULL, "model" varchar(64) NULL, "signature_family" varchar(16) NULL, "signature_model" varchar(16) NULL, "signature_stepping" varchar(16) NULL, "topology_clusters" integer NULL, "topology_cores" integer NULL, "topology_dies" integer NULL, "topology_sockets" integer NULL, "topology_threads" integer NULL, "vendor" varchar(64) NULL);
