CREATE TABLE IF NOT EXISTS "kvm_auth" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(255) NOT NULL, "password" varchar(255) NULL, "port" integer unsigned NOT NULL CHECK ("port" >= 0), "instance_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED, "created" datetime NOT NULL, "description" text NULL, "updated" datetime NOT NULL, "driver" varchar(50) NOT NULL, "extrac_params" varchar(255) NULL, "transport" varchar(50) NOT NULL, "key_file_id" bigint NULL REFERENCES "kvm_keyfile" ("id") DEFERRABLE INITIALLY DEFERRED, "path" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "kvm_xmldata" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "description" text NULL, "raw_xml" text NOT NULL, "instance_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED, "xml_hash" varchar(256) NULL, "xml_type" varchar(50) NOT NULL);
